import React from "react";

export default function Voiture({ voituree, supprimer }) {
  return (
    <tr>
      <td>{voituree.id}</td>
      <td>{voituree.Marque}</td>
      <td>{voituree.TypeCarburant}</td>
      <td>{voituree.PrixLocation}</td>
      <img
        src={`http://localhost:3000/images/${voituree.image}`}
        alt={voituree.Marque}
        width="100"
      />
      <td>
        {/* suppresion par confirmation  */}
        <button onClick={() => supprimer(voituree.id)}>Supprimer</button>{" "}
        {/* Fixed onClick handler */}
      </td>
    </tr>
  );
}
